/* FOR ACCOUNT FLAGS UCI00076  */
/* Create in CCLA tablespace. */

CREATE TABLE REF_ACCOUNT_FLAG(
  ACCOUNT_FLAG_ID Number(6,0) CONSTRAINT ACCOUNT_FLAG_ID_NN NOT NULL,
  ACCOUNT_FLAG_NAME Varchar2(200 ) CONSTRAINT ACCOUNT_FLAG_NAME_NN NOT NULL,
  ADD_TO_WATCHLIST Number(1,0) CONSTRAINT ADD_TO_WATCHLIST_NN NOT NULL
)
/

ALTER TABLE REF_ACCOUNT_FLAG ADD CONSTRAINT REF_ACCOUNT_FLAG_ID_PK PRIMARY KEY (ACCOUNT_FLAG_ID)
/

COMMENT ON TABLE REF_ACCOUNT_FLAG IS 'List of all Account ''flag reasons''. Each account will be mapped to 0 or more unique flag reasons via the ACCOUNT_FLAG_APPLIED table.'
/



CREATE TABLE ACCOUNT_FLAG_APPLIED(
  ACCOUNT_FLAG_APPLIED_ID Number(15,0) NOT NULL,
  ACCOUNT_ID Number(15,0) NOT NULL,
  ACCOUNT_FLAG_ID Number(6,0) NOT NULL,
  DATE_ADDED Timestamp(6) CONSTRAINT ACCFLAGAPPL_DATEADDED_NN NOT NULL
)
/

ALTER TABLE ACCOUNT_FLAG_APPLIED ADD CONSTRAINT ACCOUNT_FLAG_APPLIED_PK PRIMARY KEY (ACCOUNT_FLAG_APPLIED_ID)
/

ALTER TABLE ACCOUNT_FLAG_APPLIED ADD CONSTRAINT ACCOUNT_FLAG_APPLIED_UQ UNIQUE (ACCOUNT_FLAG_ID,ACCOUNT_ID)
/

COMMENT ON TABLE ACCOUNT_FLAG_APPLIED IS 'Mapping between Accounts and Account Flags.'
/

CREATE INDEX IX_ACCOUNT_ACCOUNT_FLAG_APPLIED_FK ON ACCOUNT_FLAG_APPLIED (ACCOUNT_ID) 
/
ALTER TABLE ACCOUNT_FLAG_APPLIED ADD CONSTRAINT ACCOUNT_ACCOUNT_FLAG_APPLIED_FK FOREIGN KEY (ACCOUNT_ID) REFERENCES ACCOUNT (ACCOUNT_ID)
/
CREATE INDEX IX_REF_ACCOUNT_FLAG_ACCOUNT_FLAG_APPLIED_FK ON ACCOUNT_FLAG_APPLIED (ACCOUNT_FLAG_ID) 
/
ALTER TABLE ACCOUNT_FLAG_APPLIED ADD CONSTRAINT REF_ACCOUNT_FLAG_ACCOUNT_FLAG_APPLIED_FK FOREIGN KEY (ACCOUNT_FLAG_ID) REFERENCES REF_ACCOUNT_FLAG (ACCOUNT_FLAG_ID)
/

REM INSERTING into REF_ACCOUNT_FLAG

/* Run as UCMADMIN */
CREATE SEQUENCE "UCMADMIN"."SEQ_ACCOUNT_FLAG_APPLIED_ID" MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1 START WITH 1 CACHE 20 NOORDER NOCYCLE ;
   
  
/* as dba */
CREATE OR REPLACE PUBLIC SYNONYM REF_ACCOUNT_FLAG FOR CCLA.REF_ACCOUNT_FLAG;
CREATE OR REPLACE PUBLIC SYNONYM ACCOUNT_FLAG_APPLIED FOR CCLA.ACCOUNT_FLAG_APPLIED;

GRANT ALL ON REF_ACCOUNT_FLAG TO UCMADMIN;
GRANT ALL ON ACCOUNT_FLAG_APPLIED TO UCMADMIN;

/* as ucmadmin - THIS SHOULD TRANSFER ALL EXISTING DATA FROM CCLA_ACCOUNT_AURORA_UPDATES TO NEW TABLE*/
SELECT SEQ_ACCOUNT_FLAG_APPLIED_ID.NEXTVAL  AS ACCOUNT_FLAG_APPLIED_ID, caau.ACCOUNT_ID AS ACCOUNT_ID,
raf.account_flag_id as account_flag_id,
SYSDATE AS date_added
FROM CCLA_ACCOUNT_AURORA_UPDATES caau 
INNER JOIN REF_ACCOUNT_FLAG raf ON (raf.account_flag_name = caau.update_type)

/* when you are sure that all rows have been transferred to new table */
DROP TABLE CCLA_ACCOUNT_AURORA_UPDATES

/* END ACCOUNT FLAGS UCI00076  */


/* START issue UCI00093 */
/* START refactoring REF_ORG_CATEGORY */

/* New table REF_ORG_CATEGORY_NAME. */
CREATE TABLE REF_ORG_CATEGORY_NAME(
  ORG_CATEGORY_NAME_ID Number(10,0) NOT NULL,
  ORG_CATEGORY_NAME Varchar2(100 ) CONSTRAINT ORGCATNAME_NN NOT NULL
)
/

ALTER TABLE REF_ORG_CATEGORY_NAME ADD CONSTRAINT REF_ORG_CATEGORY_NAME_PK PRIMARY KEY (ORG_CATEGORY_NAME_ID)
/
COMMENT ON TABLE REF_ORG_CATEGORY_NAME IS 'List of category names. They are held in their own table like this to prevent excessive duplication of strings in the REF_ORG_CATEGORY table, at different levels of the hierarchy (e.g. Diocese names)'
/

/* as dba */
CREATE OR REPLACE PUBLIC SYNONYM REF_ORG_CATEGORY_NAME FOR CCLA.REF_ORG_CATEGORY_NAME;
GRANT ALL ON REF_ORG_CATEGORY_NAME TO UCMADMIN;

/* Insert all org category names. */
REM INSERTING into REF_ORG_CATEGORY_NAME

/* Add new column to REF_ORG_CATEGORY. */
ALTER TABLE REF_ORG_CATEGORY ADD (
  CATEGORY_NAME_ID Number(10,0)
)
/

/* Update existing Org Category name IDs. Should update 116 lines. */
UPDATE REF_ORG_CATEGORY SET CATEGORY_NAME_ID=CATEGORY_ID;

-- FK between REF_ORG_CATEGORY_NAME and REF_ORG_CATEGORY
CREATE INDEX IX_ORGCATEGORY_ORGCATEGORY_FK ON REF_ORG_CATEGORY (CATEGORY_NAME_ID) 
/
ALTER TABLE REF_ORG_CATEGORY ADD CONSTRAINT ORGCATEGORYNAME_ORGCATEGORY_FK FOREIGN KEY (CATEGORY_NAME_ID) REFERENCES REF_ORG_CATEGORY_NAME (ORG_CATEGORY_NAME_ID)
/

COMMENT ON TABLE REF_ORG_CATEGORY IS 'Organisation Category is the Legal Status of the Organisation.
Some categories may have 2 or three hierarchical levels, so a materialized view should be created to easily view what categories an organisation is assigned to.'
/
COMMENT ON COLUMN REF_ORG_CATEGORY.UNIQUE_IDENTIFER_TYPE IS 'Any field that can be used as a unique identifier for an Organisation that exists in this category (i.e. Charity -> Charity Reg number, etc)'
/

/* Create temp table to store new CBF category mapping */
CREATE TABLE REF_ORG_CATEGORY_CBF_TEMP (
  CATEGORY_ID Number(10,0) CONSTRAINT CATEGORYID_TMP_NN NOT NULL,
  PARENT_CATEGORY_ID Number(3,0),
  CATEGORY_NAME_ID Number(10,0),
  CBF_CLIENT_NUMBER Number(10,0),
  CONSTRAINT REF_ORG_CATEGORY_TMP_PK PRIMARY KEY (CATEGORY_ID)
);

 ALTER TABLE REF_ORG_CATEGORY MODIFY (CATEGORY_ID Number(10,0));
 ALTER TABLE ORGANISATION MODIFY (CATEGORY_ID Number(10,0));

/* Add temp CBF mapping data */
REM INSERTING into REF_ORG_CATEGORY_CBF_TEMP

/* Now copy new categories into core table. */
SELECT CATEGORY_ID, PARENT_CATEGORY_ID, 'None', null, CATEGORY_NAME_ID
FROM REF_ORG_CATEGORY_CBF_TEMP cbfcat;

/* Test that all categories have been allocated a name. */
SELECT * FROM REF_ORG_CATEGORY cat INNER JOIN REF_ORG_CATEGORY_NAME catname ON (cat.category_name_id = catname.org_category_name_id);

/* Now assign categories to our CBF orgs. This is done progressively */

/* First assign top-level CoE categories to ALL CBF clients. */
UPDATE ORGANISATION orgMain SET CATEGORY_ID = (  
  SELECT cbfcat.category_id 
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (substr(clmap.CLIENT_NUMBER, 1, 1) = cbfcat.cbf_client_number)
  INNER JOIN REF_ORG_CATEGORY_NAME catname ON (cbfcat.category_name_id = catname.org_category_name_id)
  
   WHERE orgMain.ORGANISATION_ID = ORG.ORGANISATION_ID
) WHERE orgMain.ORGANISATION_ID IN (

  SELECT org.ORGANISATION_ID 
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (substr(clmap.CLIENT_NUMBER, 1, 1) = cbfcat.cbf_client_number)
);

/* Now assign second-level CoE categories where applicable. */
UPDATE ORGANISATION orgMain SET CATEGORY_ID = (  
  SELECT cbfcat.category_id 
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (substr(clmap.CLIENT_NUMBER, 1, 3) = cbfcat.cbf_client_number)
  INNER JOIN REF_ORG_CATEGORY_NAME catname ON (cbfcat.category_name_id = catname.org_category_name_id)
  
   WHERE orgMain.ORGANISATION_ID = ORG.ORGANISATION_ID
   
)  WHERE orgMain.ORGANISATION_ID IN (

  SELECT org.ORGANISATION_ID 
  FROM ORGANISATION org
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (substr(clmap.CLIENT_NUMBER, 1, 3) = cbfcat.cbf_client_number)
);

/* Finally, assign third-level CoE categories where applicable. */
UPDATE ORGANISATION orgMain SET CATEGORY_ID = (
  SELECT cbfcat.category_id 
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (clmap.CLIENT_NUMBER = cbfcat.cbf_client_number)
  INNER JOIN REF_ORG_CATEGORY_NAME catname ON (cbfcat.category_name_id = catname.org_category_name_id)
  
   WHERE orgMain.ORGANISATION_ID = ORG.ORGANISATION_ID AND org.ORGANISATION_ID IS NOT NULL
   
)  WHERE orgMain.ORGANISATION_ID IN (

  SELECT org.ORGANISATION_ID 
  FROM ORGANISATION org
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  INNER JOIN REF_ORG_CATEGORY_CBF_TEMP cbfcat ON (clmap.CLIENT_NUMBER = cbfcat.cbf_client_number)
);

/* Check for full category assignment across all CBF clients. This query should return no results. */
 SELECT *
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2)
  WHERE CATEGORY_ID IS NULL;

/* Verify category distribution */
SELECT CATEGORY_ID, COUNT(CATEGORY_ID)
  FROM ORGANISATION org 
  INNER JOIN CLIENT_AURORA_MAP clmap ON (org.ORGANISATION_ID = clmap.ORGANISATION_ID AND clmap.company_id=2) GROUP BY CATEGORY_ID;
  
/* Updated view. */
CREATE OR REPLACE FORCE VIEW "CCLA"."V_ORG_CATEGORY" ("CATEGORY_ID", "PARENT_CATEGORY_ID", "CATEGORY_NAME", "UNIQUE_IDENTIFER_TYPE", "CATEGORY_LEVEL", "BASE_CAT_ID", "BASE_CAT_NAME", "CATEGORY_PATH")
AS
SELECT c."CATEGORY_ID",
    c."PARENT_CATEGORY_ID",
    n."ORG_CATEGORY_NAME",
    c."UNIQUE_IDENTIFER_TYPE",
    level category_level ,
    connect_by_root category_id base_cat_id ,
    connect_by_root org_category_name base_cat_name ,
    SYS_CONNECT_BY_PATH(n."ORG_CATEGORY_NAME", '|') category_path
  FROM ref_org_category c
    INNER JOIN ref_org_category_name n ON (c.category_name_id = n.org_category_name_id)
    CONNECT BY PRIOR c.category_id = c.parent_category_id;

/* Grant UCMADMIN rights to special view */
CREATE OR REPLACE PUBLIC SYNONYM V_ORG_CATEGORY FOR CCLA.V_ORG_CATEGORY;
GRANT ALL ON V_ORG_CATEGORY TO UCMADMIN;
	
/* End refactoring REF_ORG_CATEGORY */
/* End issue UCI00093 */

/*  ATLAS ISSUE UCI00080 - update existing relations where org-person relation is missing but account-person relation exists - 6 separate queries  */

/* CORRESPONDENTS */

select SEQ_ELEMENT_RELATION_ID.NEXTVAL  AS RELATION_ID,1 as RELATION_NAME_ID, allrels.organisation_id as ELEMENT_ID1,
allrels.person_id as ELEMENT_ID2, SYSDATE AS RELATION_DATE, SYSDATE AS LAST_UPDATED
FROM (
SELECT organisation_id, person_id
FROM 
( (select pers.person_id, acc.account_id, aec.organisation_id from person pers 
inner join relations rel on rel.element_id1 = pers.person_id
inner join account acc on rel.element_id2 = acc.account_id
left join account_extended_client aec on aec.account_id = acc.account_id
where rel.relation_name_id = 80)  accounts
left join 
( select p.person_id as orgperson, o.organisation_id as orgorg from person p 
inner join relations rel on rel.element_id2 = p.person_id
inner join organisation o on rel.element_id1 = o.organisation_id
where rel.relation_name_id = 1)   orgs
on accounts.person_id = orgs.orgperson AND accounts.organisation_id = orgs.orgorg )
where orgs.orgperson is null  GROUP BY organisation_id, person_id ) allrels


